import React, { Component } from 'react';
import "./resume.css";
import CV from "./CV.pdf";


export default class Resume extends Component {
  render() {
    return (
        <div id="resume-wrapper">
            <div id="resume-container">
            <a id="download-button" href={CV} download>
                <button class="btn"><i class="fa fa-download"></i> Download resume </button>
            </a>
            <div id="resume-written">
                <div class="resume-section">
                    <h1>Education</h1><hr/>
                    Bachelor's degree in Computer Science - 2018 to 2021(expected)

                </div>

                <div class="resume-section">
                    <h1>Professional experience</h1><hr/>

                </div>

                <div class="resume-section">
                    <h1>Online courses</h1><hr/>

                </div>

                <div class="resume-section">
                    <h1>Competitions</h1><hr/>

                </div>
            </div>
        </div>
        </div>
    );
  }
}
